  //     })
  //   );
  // }

  return (
    <div className="App">
      <Header portal="Patient Portal"></Header>
      <Intro></Intro>
      {doctorList}
      <DoctorList firstName="Adam" lastName="Golding" id="1"></DoctorList>
      <DoctorList firstName="Horace" lastName="Pang" id="4"></DoctorList>
      <DoctorList firstName="Yash" lastName="Diwan" id="3"></DoctorList>
      <DoctorList firstName="William" lastName="Ling" id="2"></DoctorList>

      {/* <button>Log in as Patient</button>
        <button>Log in as Docotr</button> */}
    </div>
  );
};

export default PatientPage;
